import React from "react";
import { Grid, Container } from "semantic-ui-react";
import { FileInput } from "components/FileInput";

interface IAction<P> {
  type: string;
  payload?: P;
}

const filesReducer = (state: any[] = [], action: IAction<any[]>): any[] => {
  switch (action.type) {
    default:
      return state;
  }
};

function App() {
  return (
    <Container>
      <Grid>
        <Grid.Row>
          <FileInput name="files" />
        </Grid.Row>
      </Grid>
    </Container>
  );
}

export default App;
